import React from 'react';
import HackerAnimation from './HackerAnimation';

function HomePage() {
  return (
    <div className="container">
      <h1>Welcome to My Hacker Den</h1>
      <HackerAnimation />
      <p>
        The world of hacking is a digital battleground, where every keystroke can uncover hidden vulnerabilities, 
        and every line of code has the potential to break barriers. Here, I dive deep into the art of hacking, 
        exploring systems, testing their limits, and uncovering what lies beneath the surface.
      </p>
      <h2>Hacking Domains I Explore:</h2>
      <ul>
        <li>Web Application Security</li>
        <li>Network Penetration Testing</li>
        <li>Exploit Development</li>
        <li>Reverse Engineering</li>
        <li>Social Engineering Tactics</li>
        <li>Cryptographic Analysis</li>
      </ul>
    </div>
  );
}

export default HomePage;
